import Link from 'next/link';
import withLayout from "./Layout"


const Content = props => {
  return (
      <li>
        <Link href="/p/[id]" as={`/p/${props.id}`}>
          <a>{props.id}</a>
        </Link>
      </li>
    );
}

export default withLayout(Content);
